import React, {} from "react";
import "./Styles.css";
import { motion, useScroll } from "framer-motion";
import TopBar from "../TopBar/TopBar";

const FullPanel1 = () => {
  return (
    <div>
      <div className="TopBar">
        <TopBar />
      </div>
      {/*?xml version="1.0" encoding="utf-8"?*/}
      {/* 2023-12-21 Thu 18:21 */}
